import re


class Solution(object):
    def isLongPressedNameSlow(self, name, typed):
        """
        :type name: str
        :type typed: str
        :rtype: bool
        """
        pattern = ''
        pre = ''
        for char in name:
            pattern += char + '+'
        pattern += '$'
        if re.match(pattern, typed):
            return True
        return False

    def isLongPressedName(self, name, typed):
        i = 0
        j = 0
        pre = ''
        while i < len(name) and j < len(typed):
            cur = name[i]
            if typed[j] != cur:
                while j < len(typed) and typed[j] == pre:
                    j += 1
                if j == len(typed) or typed[j] != cur:
                    return False
            j += 1
            i += 1
            pre = cur
        if i != len(name):
            return False
        while j < len(typed):
            if typed[j] != pre:
                return False
            j += 1
        return True

    def minFlipsMonoIncr(self, S):
        """
        :type S: str
        :rtype: int
        """
        zeroCount = 0
        oneCount = 0
        zero_base = [0]
        one_base = []
        minVal = float('inf')
        for i in range(len(S)):
            if S[i] == '1':
                zeroCount += 1
            zero_base.append(zeroCount)
        for i in range(len(S) - 1, -1, -1):
            if S[i] == '0':
                oneCount += 1
            one_base.append(oneCount)
        one_base = one_base[::-1]
        one_base.append(0)
        print(one_base, zero_base)
        for i in range(len(S) + 1):
            if zero_base[i] + one_base[i] < minVal:
                minVal = zero_base[i] + one_base[i]
        return minVal

    def threeEqualParts(self, A):
        """
        :type A: List[int]
        :rtype: List[int]
        """
        Astr = ''
        for i in range(len(A)):
            Astr += str(A[i])
        i = 0
        j = 2
        n = len(A)
        iter = 0
        f = int(Astr[0:i + 1], 2)
        s = int(Astr[i + 1:j], 2)
        t = int(Astr[j:], 2)
        while j < n:
            iter += 1
            if f == s:
                if s == t:
                    return [i, j]
                else:
                    j += 1
                    s *= 2
                    s += A[j - 1]
                    t -= A[j - 1] * (1<<(n-j))
            else:
                if i + 2 < j and f < s:
                    i += 1
                    f *= 2
                    f += A[i]
                    s -= A[i] * (1<<(j-i-1))
                else:
                    j += 1
                    s *= 2
                    s += A[j - 1]
                    t -= A[j - 1] * (1<<(n-j))
        return [-1, -1]

